import react, { useState } from 'react';
import TextField from '@mui/material/TextField';
import InputAdornment from '@mui/material/InputAdornment';
import AccountCircle from '@mui/icons-material/AccountCircle';
import VisibilityIcon from '@mui/icons-material/Visibility';
import VisibilityOffIcon from '@mui/icons-material/VisibilityOff';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import { styled } from '@mui/material/styles';
import FormControl from '@mui/material/FormControl';
import Input from '@mui/material/Input';
import Checkbox from '@mui/material/Checkbox';
import InputLabel from '@mui/material/InputLabel';
import IconButton from '@mui/material/IconButton';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';
import OutlinedInput from '@mui/material/OutlinedInput';
import FormControlLabel from '@mui/material/FormControlLabel';
import './login-style.css';

const Campos = () => {

	const [verSenha, setVerSenha] = useState(false);
	const [teste, setTeste] = useState('');

	const [values, setValues] = useState({
    amount: '',
    password: '',
    weight: '',
    weightRange: '',
    showPassword: false,
  });

  const handleChange =
    (prop) => (event) => {
      setValues({ ...values, [prop]: event.target.value });
    };

  const handleClickShowPassword = () => {
    setValues({
      ...values,
      showPassword: !values.showPassword,
    });
  };

  const handleMouseDownPassword = (event) => {
    event.preventDefault();
  };

	const BootstrapButton = styled(Button)({
		boxShadow: 'none',
		textTransform: 'none',
		fontSize: 16,
		padding: '6px 12px',
		border: '1px solid',
		lineHeight: 1.5,
		backgroundColor: 'purple',
		borderColor: 'purple',
		fontFamily: [
			'-apple-system',
			'BlinkMacSystemFont',
			'"Segoe UI"',
			'Roboto',
			'"Helvetica Neue"',
			'Arial',
			'sans-serif',
			'"Apple Color Emoji"',
			'"Segoe UI Emoji"',
			'"Segoe UI Symbol"',
		].join(','),
		'&:hover': {
			backgroundColor: 'purple',
			borderColor: 'purple',
			boxShadow: 'none',
			cursor: 'pointer',
		},
		'&:active': {
			boxShadow: 'none',
			backgroundColor: 'purple',
			borderColor: 'purple',
		},
		'&:focus': {
			boxShadow: '0 0 0 0.2rem rgba(0,123,255,.5)',
		},
	});

	const CssTextField = styled(TextField)({
		'& label.Mui-focused': {
			color: 'purple',
		},
		'& fieldset': {
      width: '95%'
    },
		'& .MuiInput-underline:after': {
			borderBottomColor: 'purple',
		},
		'& .MuiOutlinedInput-root': {
			'&:hover fieldset': {
				borderColor: 'purple',
			},
			'&.Mui-focused fieldset': {
				borderColor: 'purple',
			},
		},
	});

	const CssTextFieldPassword = styled(OutlinedInput)({
		'& label.Mui-focused': {
			color: 'purple',
		},
		'& fieldset': {
      width: '95%'
    },
		'& .MuiInput-underline:after': {
			borderBottomColor: 'purple',
		},
		'& .MuiOutlinedInput-root': {
			'&:hover fieldset': {
				borderColor: 'purple',
			},
			'&.Mui-focused fieldset': {
				borderColor: 'purple',
			},
		},
	});

	return (
		<div className="container-campos">
			<form action="">
				<Stack spacing={2}>
					<h2 htmlFor="custom-css-outlined-input">Sign In</h2>
					<CssTextField
						label="Email"
						id="custom-css-outlined-input"
						InputProps={{
							startAdornment: (
								<InputAdornment position="start">
									<AccountCircle />
								</InputAdornment>
							),
						}} />
						<CssTextField
							id="input-with-icon-textfield"
							label="Senha"
							type={verSenha ? 'text' : 'password'}
							onChange={e => setTeste(e.target.value)}
							value={teste}
							InputProps={{
								startAdornment: (
									<InputAdornment style={{ cursor: 'pointer' }} position="start">
										<IconButton
											aria-label="toggle password visibility"
											onClick={(e) => { setVerSenha(!verSenha); }}
											//onMouseDown={handleMouseDownPassword}
											edge="start">
											{verSenha ? <VisibilityOff /> : <Visibility />}
										</IconButton>
									</InputAdornment>
								),
							}}
						variant="outlined" />
						<FormControl sx={{ m: 1, width: 'auto' }} variant="outlined">
							<InputLabel htmlFor="outlined-adornment-password">Password</InputLabel>
							<OutlinedInput
								id="outlined-adornment-password"
								type={values.showPassword ? 'text' : 'password'}
								value={values.password}
								onChange={handleChange('password')}
								startAdornment={
									<InputAdornment position="start">
										<IconButton
											aria-label="toggle password visibility"
											onClick={handleClickShowPassword}
											onMouseDown={handleMouseDownPassword}
											edge="start"
										>
											{values.showPassword ? <VisibilityOff /> : <Visibility />}
										</IconButton>
									</InputAdornment>
								}
								label="Password"
							/>
						</FormControl>
					<FormControlLabel
						value="end"
						control={<Checkbox color="default" />}
						label="Lembrar senha?"
						labelPlacement="end" />
					<BootstrapButton variant="contained" disableRipple>Login</BootstrapButton>
					<a href="/"><h5 style={{ textAlign: 'center' }}>Novo aqui? Criar uma conta</h5></a>
				</Stack>
			</form>
		</div>
	);
};

export default Campos;
